import Calendar from "./components/Calendar";
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <div id="logo">

        <span>
           react <b>calendar</b>
        </span>
      </div>
      </header>
      <main>

          <Calendar />

        </main>
    </div>
  );
}

export default App;
